import React, { useEffect, useState } from 'react';
import { useLocation } from 'react-router-dom';

const SearchResults = () => {
  const [soldiers, setSoldiers] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const [totalPages, setTotalPages] = useState(0);
  const location = useLocation();

  useEffect(() => {
    const queryParams = new URLSearchParams(location.search);
    const surname = queryParams.get('surname');
    const name = queryParams.get('name');
    const fathername = queryParams.get('fathername');
    const page = queryParams.get('page') || 1;

    fetch(`http://localhost:1337/soldiers/search?surname=${surname}&name=${name}&fathername=${fathername}&page=${page}`)
      .then(response => response.json())
      .then(data => {
        setSoldiers(data.results);
        setTotalPages(data.totalPages);
        setCurrentPage(data.currentPage);
      })
      .catch(error => console.error('Error fetching search results:', error));
  }, [location.search]);

  const renderPagination = () => {
    let startPage = Math.max(currentPage - 5, 1);
    let endPage = Math.min(startPage + 9, totalPages);

    const pages = [];
    for (let i = startPage; i <= endPage; i++) {
      pages.push(i);
    }

    return (
      <div className="pagination">
        <button onClick={() => changePage(1)} disabled={currentPage === 1}>&lt;&lt;</button>
        <button onClick={() => changePage(currentPage - 1)} disabled={currentPage === 1}>&lt;</button>
        {pages.map(page => (
          <button key={page} disabled={page === currentPage} onClick={() => changePage(page)}>
            {page}
          </button>
        ))}
        <button onClick={() => changePage(currentPage + 1)} disabled={currentPage === totalPages}>&gt;</button>
        <button onClick={() => changePage(totalPages)} disabled={currentPage === totalPages}>&gt;&gt;</button>
      </div>
    );
};


  const changePage = (newPage) => {
    const queryParams = new URLSearchParams(location.search);
    queryParams.set('page', newPage);
    window.location.search = queryParams.toString();
  };

  return (
    <div className="generalPages">
      <h1>Search Results</h1>
      {soldiers.map((soldier, index) => (
        <div key={index} style={{ marginBottom: "20px" }}> {/* Added space between soldiers */}
          <h3>{[soldier.s_surname, soldier.s_name, soldier.s_fathername].filter(Boolean).join(' ')}</h3>
          <ul>
            {soldier.s_birthyear && <li>DoB: {soldier.s_birthyear}</li>}
            {soldier.s_birthrepublic && <li>Republic: {soldier.s_birthrepublic}</li>}
            {soldier.s_birthregion && <li>Region: {soldier.s_birthregion}</li>}
            {soldier.s_birthrayon && <li>Rayon: {soldier.s_birthrayon}</li>}
            {soldier.s_birthtown && <li>Town: {soldier.s_birthtown}</li>}
            {soldier.s_calledby && <li>Called By: {soldier.s_calledby}</li>}
            {soldier.s_rank && <li>Rank: {soldier.s_rank}</li>}
            {soldier.s_deathdate && <li>DoD: {soldier.s_deathdate}</li>}
            {soldier.s_burialplace && <li>Burial: {soldier.s_burialplace}</li>}
            {soldier.s_milforce && <li>Milforce: {soldier.s_milforce}</li>}
            {soldier.s_reason && <li>Reason: {soldier.s_reason}</li>}
          </ul>
        </div>
      ))}
      {renderPagination()}
    </div>
  );
};

export default SearchResults;
